import React, { useState } from 'react';
import PropTypes from 'prop-types';
import { Redirect } from 'react-router-dom';

const NewTask = () => {
  const [taskType, setTaskType] = useState(null);

  const addTask = () => {
    if(taskType == 'openTask') <Redirect to={'/addOpenTask'} />
  }
  
  return <>
    <button onClick={()=>addTask()}>Dodaj zadanie</button>
    <select
      value={taskType}
      onChange={(e)=>setTaskType(e.target.value)}
    >
      <option value={null}>Wybierz odpowiedz</option>
      <option value={'openTask'}>Zadanie otwarte</option>
      <option value={'closeTask'}>Zadanie zamknięte</option>
      <option value={'booleanTask'}>Zadanie prawda fałsz</option>
    </select>
  </>

}



export default NewTask;
